import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Get initial cart count
    const initialCartCount = await page.$eval('.cart', el => {
      const text = el.textContent.trim();
      return parseInt(text.match(/^\d+/)?.[0] || '0');
    });

    // Add multiple products to cart rapidly
    const addToCartButtons = await page.$$('.product-card .add-to-cart');

    // Add first 3 products to cart
    for (let i = 0; i < Math.min(3, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      await page.waitForTimeout(200); // Brief pause between additions
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_adding.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_adding.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Perform rapid cart manipulations
    const cartItems = await page.$$('.cart-item');

    if (cartItems.length > 0) {
      // Increase quantity of first item
      const firstItemPlus = await page.$('.cart-item:first-child .quantity-btn:last-child');
      await firstItemPlus.click();
      await page.waitForTimeout(100);

      // Decrease quantity of second item (if exists)
      if (cartItems.length > 1) {
        const secondItemMinus = await page.$('.cart-item:nth-child(2) .quantity-btn:first-child');
        await secondItemMinus.click();
        await page.waitForTimeout(100);
      }

      // Remove third item (if exists)
      if (cartItems.length > 2) {
        const thirdItemRemove = await page.$('.cart-item:nth-child(3) .remove-item');
        await thirdItemRemove.click();
        await page.waitForTimeout(100);
      }
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_after_manipulations.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_after_manipulations.png'));

    // Close cart modal
    await page.click('.close');
    await page.waitForTimeout(500);

    // Get final cart count
    const finalCartCount = await page.$eval('.cart', el => {
      const text = el.textContent.trim();
      return parseInt(text.match(/^\d+/)?.[0] || '0');
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_final.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_final.png'));

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test with multiple add/remove/quantity operations",
      extractedData: {
        initialCartCount,
        finalCartCount,
        itemsManipulated: Math.min(3, addToCartButtons.length)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
